Champion.destroy_all

@garen = Champion.create!(name: 'Garen', lore: "A proud and noble warrior, Garen fights as one of the Dauntless Vanguard. He is popular among his fellows, and respected well enough by his enemies—not least as a scion of the prestigious Crownguard family, entrusted with defending Demacia and its Pride.", img: 'data:image/jpeg;base64,', role: 'Tank, Fighter', lane: 'Top')

@yone = Champion.create!(name: 'Yone', lore: "In life, he was Yone—half-brother of Yasuo, and renowned student of his village's sword school. But upon his death at the hands of his brother, he found himself hunted by a malevolent entity of the spirit realm, and was forced to slay it with its own hands.", img: 'data:image/jpeg;base64,', role: 'Assassin, Fighter', lane: 'Top')

@sett = Champion.create!(name: 'Sett', lore: "The yordle pilot Corki loves two things above all others: flying, and his glamorous mustache... though not necessarily in that order. After leaving Bandle City, he settled in Piltover and fell in love with the wondrous machines he found there.", img: 'data:image/jpeg;base64,', role: 'Fighter, Tank', lane: 'Top')

@aatrox = Champion.create!(name: 'Aatrox', lore: 'Once honored defenders of Shurima against the Void, Aatrox and his brethren would eventually become an even greater threat to Runeterra, and were defeated only by cunning mortal sorcery. But after centuries of imprisonment, Aatrox was the first to find release the true powers of the darkin and destroy the country.', img: 'data:image/jpeg;base64,', role: 'Fighter', lane: 'Top')

@riven = Champion.create(name: 'Riven', lore: "Once a swordmaster in the warhosts of Noxus, Riven rose through the ranks on the strength of her conviction and brutal efficiency, and was rewarded with a legendary runic blade and a warband of her own. However, on the Ionian front, Riven’s faith in her nation was tested and ultimately broken. She severed all ties to the empire, seeking to find her place in a shattered world, even as rumors abounded that Noxus had been reforged.", img: 'data:image/jpeg;base64,', role: 'Fighter, Assassin', lane: 'Top')

@anivia = Champion.create!(name: 'Anivia', lore: 'Anivia is a benevolent winged spirit who endures endless cycles of life, death, and rebirth to protect the Freljord. A demi-god born of unforgiving ice and bitter winds, she wields those elemental powers to thwart any who dare disturb her homeland. Anivia guides and protects the tribes of the harsh north, who revere her as a symbol of hope, and a portent of great change. She fights with every ounce of her being, knowing that through her sacrifice, her memory will endure, and she will be reborn into a new tomorrow.', img: 'data:image/jpeg;base64,', role: 'Mage', lane: ' Mid')

@yasuo = Champion.create!(name: 'Yasuo', lore: '
An Ionian of deep resolve, Yasuo is an agile swordsman who wields the air itself against his enemies. As a proud young man, he was falsely accused of murdering his master—unable to prove his innocence, he was forced to slay his own brother in self-defense. In time, his master’s true killer was revealed, and his brother mysteriously returned from death, yet Yasuo still could not forgive himself for all he had done. Now, he wanders the world with only the wind to guide his blade.', img: 'data:image/jpeg;base64,', role: 'Fighter, Assassin', lane: 'Mid')

@veigar = Champion.create!(name: 'Veigar', lore: 'An enthusiastic yordle sorcerer, Veigar has embraced powers that few others dare even approach. As a free-spirited inhabitant of Bandle City, he once longed to learn more of the celestial magic practiced by mortals, but his natural curiosity was twisted by imprisonment in the Immortal Bastion. Now a stubborn creature with the dark fury of the stars at his command, Veigar is often underestimated by others—and though he believes himself truly evil, there are some who still question his deeper motivations…', img: 'data:image/jpeg;base64,', role: 'Mage', lane: 'Mid')

@viktor = Champion.create!(name: 'Viktor', lore: 'The herald of a new age of technology, Viktor has devoted his life to the advancement of humankind. An idealist who seeks to lift the people of Zaun to a new level of understanding, he believes that only by embracing a glorious evolution of technology can humanity’s full potential be realized. With a body augmented by steel and science, Viktor is zealous in his pursuit of this bright future.', img: 'data:image/jpeg;base64,:', role: 'Mage', lane: 'Mid')

@ahri = Champion.create!(name: 'Ahri', lore: 'Innately connected to the magic of the spirit realm, Ahri is a mysterious fox-like vastaya in search of her place in the world. Having become a somewhat reluctant and empathetic predator since entering mortal society, she prefers to manipulate her prey’s emotions before partaking of their life essence—receiving flashes of memory and insight from each soul she consumes.', img: 'data:image/jpeg;base64,', role: 'Mage, Assassin', lane: 'Mid')

@fiddlesticks = Champion.create!(name: 'Fiddlesticks', lore: 'horror known as Fiddlesticks stalks the edges of mortal society, drawn to areas thick with paranoia where it feeds upon terrorized victims. Wielding a jagged scythe, the haggard, makeshift creature reaps fear itself, shattering the minds of those unlucky enough to survive in its wake. Beware the sounding of the crow, or the whispering of the shape that appears almost human… Fiddlesticks has returned.', img: 'data:image/jpeg;base64,:', role: 'Mage, Assassin', lane: 'Jungle')

@khazix = Champion.create!(name: "Kha'zix", lore: '
The Void grows, and the Void adapts—in none of its myriad spawn are these truths more apparent than Kha’Zix. Evolution drives the core of this mutating horror, born to survive and to slay the strong. Where it struggles to do so, it grows new, more effective ways to counter and kill its prey. Initially a mindless beast, Kha’Zix’s intelligence has developed as much as its form. Now, the creature plans out its hunts, and even utilizes the visceral terror it engenders in its victims.', img: 'data:image/jpeg;base64,', role: 'Assassin', lane: 'Jungle')

@kindred = Champion.create!(name: 'Kindred', lore: '
Separate, but never parted, Kindred represents the twin essences of death. Lamb’s bow offers a swift release from the mortal realm for those who accept their fate. Wolf hunts down those who run from their end, delivering violent finality within his crushing jaws. Though interpretations of Kindred’s nature vary across Runeterra, every mortal must choose the true face of their death.
', img: 'data:image/jpeg;base64,', role: 'Marksman', lane: 'Jungle')

@shaco = Champion.create!(name: 'Shaco', lore: 'Crafted long ago as a plaything for a lonely prince, the enchanted marionette Shaco now delights in murder and mayhem. Corrupted by dark magic and the loss of his beloved charge, the once-kind puppet finds pleasure only in the misery of the poor souls he torments. He uses toys and simple tricks to deadly effect, finding the results of his bloody “games” hilarious—and for those who hear a dark chuckle in the dead of night, the Demon Jester may have marked them as his next plaything.', img: 'data:image/jpeg;base64,:', role: 'Assassin', lane: 'Jungle')

@warwick = Champion.create!(name: 'Warwick', lore: '
Warwick is a monster who hunts the gray alleys of Zaun. Transformed by agonizing experiments, his body is fused with an intricate system of chambers and pumps, machinery filling his veins with alchemical rage. Bursting out of the shadows, he preys upon those criminals who terrorize the city’s depths. Warwick is drawn to blood, and driven mad by its scent. None who spill it can escape him.', img: 'data:image/jpeg;base64,:', role: 'Fighter, Tank', lane: 'Jungle')

@kogmaw = Champion.create!(name: "Kog'maw", lore: 'Belched forth from a rotting Void incursion deep in the wastelands of Icathia, Kog’Maw is an inquisitive yet putrid creature with a caustic, gaping mouth. This particular Void-spawn needs to gnaw and drool on anything within reach to truly understand it. Though not inherently evil, Kog’Maw’s beguiling naiveté is dangerous, as it often precedes a feeding frenzy—not for sustenance, but to satisfy its unending curiosity.', img: 'data:image/jpeg;base64,', role: 'Marksman', lane: 'Bot Carry')

@twitch = Champion.create!(name: 'Twitch', lore: 'A Zaunite plague rat by birth, but a connoisseur of filth by passion, Twitch is not afraid to get his paws dirty. Aiming a chem-powered crossbow at the gilded heart of Piltover, he has vowed to show those in the city above just how filthy they really are. Always a sneaky sneak, when he’s not rooting around in the Sump, he’s digging deep into other people’s garbage for discarded treasures… and perhaps a moldy sandwich.', img: 'data:image/jpeg;base64,::', role: 'Marksman', lane: 'Bot Carry')

@tristana = Champion.create!(name: ' Tristana', lore: 'While many other yordles channel their energy into discovery, invention, or just plain mischief-making, Tristana was always inspired by the adventures of great warriors. She had heard much about Runeterra, its factions, and its wars, and believed her kind could become worthy of legend too. Setting foot in the world for the first time, she took up her trusty cannon Boomer, and now leaps into battle with steadfast courage and optimism.', img: 'data:image/jpeg;base64,', role: 'Marksman', lane: 'Bot Carry')

@jhin = Champion.create!(name: 'Jhin', lore: "
Jhin is a meticulous criminal psychopath who believes murder is art. Once an Ionian prisoner, but freed by shadowy elements within Ionia’s ruling council, the serial killer now works as their cabal's assassin. Using his gun as his paintbrush, Jhin creates works of artistic brutality, horrifying victims and onlookers. He gains a cruel pleasure from putting on his gruesome theater, making him the ideal choice to send the most powerful of messages: terror.", img: 'data:image/jpeg;base64,', role: 'Marksman', lane: 'Bot Carry')

@sivir = Champion.create!(name: 'Sivir', lore: 'Sivir is a renowned mercenary captain who plies her trade in the deserts of Shurima. Armed with her legendary jeweled crossblade, she has fought and won countless battles for those who can afford her services, and prides herself on recovering lost treasures from the catacombs beneath the old empire—for a generous share of the profits, of course. With ancient forces stirring the very bones of Shurima, Sivir now finds herself torn between conflicting destinies…', img: 'data:image/jpeg;base64,:', role: 'Marksman', lane: 'Bot Carry')

@blitzcrank = Champion.create!(name: 'Blitzcrank', lore: 'Abehemoth of burnished metal, steam, and crackling electricity, Blitzcrank walks the streets of Zaun in a tireless effort to improve the undercity and give aid to those in need. Created to descend into the most caustic and dangerous of environments in Zaun to dispose of harmful waste, they have evolved beyond the bounds of their original programming, thanks to the genius of their inventor, and the mysterious power of hextech.', img: 'data:image/jpeg;base64,', role: 'Support, Tank ', lane: 'Bot Support')

@soraka = Champion.create!(name: 'Soraka', lore: "Awanderer from the celestial realm, Soraka gave up her immortal form to protect the mortal races from their own ignorance and violent instincts. She endeavors to spread the virtues of compassion and mercy to everyone she meets—guiding the lost, and healing the wounded. For all Soraka has seen of this world's struggles, she still believes the people of Runeterra have yet to reach their full potential.", img: 'data:image/jpeg;base64,', role: 'Support, Mage', lane: 'Bot Support')

@tahmkench = Champion.create!(name: 'Tahm Kench', lore: 'Known by many names throughout history, the demon Tahm Kench travels the waterways of Runeterra, feeding his insatiable appetite with the misery of others. Though he may appear singularly charming and proud, he swaggers through the physical realm like a vagabond in search of unsuspecting prey. His lashing tongue can stun even a heavily armored warrior from a dozen paces, and to fall into his rumbling belly is to tumble into an abyss from which there is little hope of return.', img: 'data:image/jpeg;base64,', role: 'Support, Tank', lane: 'Bot Support')

@brand = Champion.create!(name: 'Brand', lore: 'Once a tribesman of the icy Freljord named Kegan Rodhe, the creature known as Brand is a lesson in the temptation of greater power. Seeking one of the legendary World Runes, Kegan betrayed his companions and seized it for himself—and, in an instant, the man was no more. His soul burned away, his body a vessel of living flame, Brand now roams Valoran in search of other Runes, swearing revenge for wrongs he could not have suffered in a dozen mortal lifetimes.', img: 'data:image/jpeg;base64,', role: 'Mage Support', lane: 'Bot Support')

@zyra = Champion.create!(name: 'Zyra', lore: 'Born in an ancient, sorcerous catastrophe, Zyra is the wrath of nature given form—an alluring hybrid of plant and human, kindling new life with every step. She views the many mortals of Valoran as little more than prey for her seeded progeny, and thinks nothing of slaying them with flurries of deadly spines. Though her true purpose has not been revealed, Zyra wanders the world, indulging her most primal urges to colonize, and strangle all other life from it.', img: 'data:image/jpeg;base64,', role: 'Mage Support', lane: 'Bot Support')

puts "#{Champion.count} champions created"